import './Slider.css'
import { useEffect, useState } from 'react';

export default function Slider({ imgs }) {
	let [img, setImg] = useState(0);

	setTimeout(() => {
		setImg((img) => img + 1);
		if (img >= imgs.lemgth)
			setImg(0);
	}, 1000);

	return (
		<div className="slider-container">
			<img className={`gallery-item`} src={img} alt="slider-item" />
		</div>
	)
}
